    false,nt"url": null,nt"notes": "BPI Structures are derived from two scales
    of a focal mean analysis on bathymetry and slope. The grid is based on gridded (10
    m cell size) multibeam bathymetry, collected aboard NOAA Ship Hi'ialakai and R/V
    AHI, and it was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
    Cell values represent one of 14 classes in an index of seafloor terrains. This data
    set is for the shelf and slope environments of Maug Island. As part of the northern
    islands of the Mariana Islands archipelago, Maug's offshore shelf, though barely
    present at Maug, is above -60m. A deep shelf (below -60m) is inside the crater just
    outside of the depressions that form a moat around the post-collapse dome. Conversely,
    the southern islands each have a shelf (above -100m) with escarpments that lead
    to broad flat areas without forming a deeper shelf.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
